import { Fragment, FunctionComponent } from "react";

import PageHeader from "../Components/Atoms/PageHeader";
import ReactPlayer from 'react-player';
import CurrentTime from "../Components/Molecules/currentTime";

const Livevideo: FunctionComponent = () => {
    return (
        <Fragment>
            <div className="center-text-video">

                <PageHeader title='live video opname' /><div className="page-container">
                    <p>
                        De tijd op dit moment is <CurrentTime></CurrentTime>
                    </p>

                    <div>
                        <ReactPlayer url="https://www.twitch.tv/riotgames" playing controls />
                    </div>
                </div>
            </div>
        </Fragment>
    );
}

export default Livevideo;
